	String findIdType(String Id){
		if(Id.equals("int")||Id.equals("boolean") || Id.equals("int[]"))
			return Id;
		String currScope = fullScope();
		String type = symbolTableVar.get(currScope+Id);
		if(type==null)
		{
			String tmp;
			tmp = scope.peek();
			String parent;
			if(symbolTableMethod.containsKey(fullScope()))
			{
				String temp1 = scope.pop();
				parent = scope.peek();
				scope.push(temp1);
			}
			else 													//class is in the top of stack
				parent = tmp;
			while(parent!=null && type == null){
				type = symbolTableVar.get(parent+":"+Id);
				parent = parentTable.get(parent);
			}
			
		}
		if(type==null && parentTable.containsKey(Id)){
			return Id;
		}
		if(type==null){
			System.out.println("Type error");
			System.exit(0);
		}
		return type; 
	}

