	public R visit(ArrayAllocationExpression n) {
		R _ret=null;
		n.f0.accept(this);
		n.f1.accept(this);
		n.f2.accept(this);
		String type = n.f3.accept(this).toString();
		if(!(type.equals("int")))
		{
			System.out.println("Type error");
			System.exit(0);	
		}
		n.f4.accept(this);
		_ret = (R)("int[]");
		return _ret;
	}

